import React from 'react';
import NavigationItem from './navigation-item/NavigationItem';
import { NavLink } from 'react-router-dom';

export const NavigationItems = ({ link, isUserLoggedIn, children }) => {
  return (
    <ul>
      <NavigationItem>
        <Link to={link}>{children}</Link> 
      </NavigationItem>
      {isUserLoggedIn ?
        <NavigationItem>
          <Link to={link}>{children}</Link> 
      </NavigationItem>
        : null}
      {isUserLoggedIn ?
        <NavigationItem>
          <Link to={link}>{children}</Link>           
      </NavigationItem>
        : <NavigationItem>
        >
                  <Link to={link}>{children}</Link> 

      </NavigationItem>}

    </ul>
  );
}
